pragma solidity ^0.8;
import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./Registration.sol";

contract Product is ERC721,Registration  {
    
    constructor() ERC721("Item","ITEM"){
    }
    
    struct Item{
        uint256 key;
        string name;
        string designer;
        uint256 registeredOn;
        bool isVerified;
        string[] imgHash;
        uint256 isBurned;
        uint256 isTransfered;
    }
    
    uint256 count = 1000;
    mapping(address=>Item[]) public productOwner;
    
    function mintItem(string memory name,string memory desg, string[] memory imgArr,address payable owner)public {
        require(User_Record[msg.sender].isAuth == true , "sender not registered");
        uint256 id = count+1;
        Item memory i = Item({key:id,name:name,designer:desg,registeredOn:block.timestamp,isVerified:true,imgHash:imgArr,isBurned:0,isTransfered:0});
        productOwner[owner].push(i);
        _safeMint(owner,id);
        count = count+1;
    }
    
    function getItems(address add)public view returns(Item[] memory){
        uint256 size = productOwner[add].length;
        Item[] memory arr = new Item[](size);
        for(uint i = 0;i<size;i++){
            Item memory prod = productOwner[add][i];
            arr[i] = prod;
        }
        return arr;
    }
    
    function transferOwnerShip(address payable newOnwer,address payable currentOwner,uint256 id) public {
        require(msg.sender == ownerOf(id),"You are not owner");
        address add = msg.sender;
        for(uint i = 0;i<productOwner[add].length;i++){
            if(productOwner[add][i].key == id){
                productOwner[add][i].isTransfered = 1;
            }
        }
        safeTransferFrom(currentOwner,newOnwer,id);
    }
    
    function deleteToken(uint256 id)public{
        require(msg.sender == ownerOf(id),"You are not owner");
        address add = msg.sender;
        Item memory res;
        for(uint i = 0;i<productOwner[add].length;i++){
            if(productOwner[add][i].key == id){
                productOwner[add][i].isBurned = 1;
                res = productOwner[add][i];
            }
        }
        _burn(id);
    }
    
    function verifyProduct(uint256 id) public{
        require(msg.sender != ownerOf(id));
        Item[] memory arr = productOwner[msg.sender];
        for(uint256 i = 0;i<arr.length;i++){
            if(arr[i].key == id){
                productOwner[msg.sender][i].isVerified = true;
            }
        }
    }
}
